// src/components/Projects.js
import React from "react";

const projects = [
  {
    title: "E-commerce Web App",
    description:
      "A full-featured e-commerce app with product listings, shopping cart, user authentication, and admin dashboard.",
    technologies: ["React", "Node.js", "Express", "MongoDB"],
    github: "https://github.com/pavithra123456678/ecommerce-app",
  },
  {
    title: "AI Image Generator",
    description:
      "An AI-powered app that generates images using OpenAI’s API based on user prompts.",
    technologies: ["React", "OpenAI API", "Tailwind CSS"],
    github: "https://github.com/pavithra123456678/ai-image-generator",
  },
];

const Projects = () => {
  return (
    <section className="py-16 px-6 bg-gray-100" id="projects">
      <h2 className="text-3xl font-bold text-center mb-12 text-gray-800">Projects</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-8 max-w-6xl mx-auto">
        {projects.map((project, index) => (
          <div
            key={index}
            className="bg-white p-6 rounded-lg shadow-md hover:shadow-xl transition-shadow"
          >
            <h3 className="text-xl font-semibold mb-2 text-blue-900">{project.title}</h3>
            <p className="text-gray-700 mb-4">{project.description}</p>
            <div className="flex flex-wrap gap-2 mb-4">
              {project.technologies.map((tech, idx) => (
                <span
                  key={idx}
                  className="bg-blue-100 text-blue-800 text-sm px-2 py-1 rounded"
                >
                  {tech}
                </span>
              ))}
            </div>
            <a
              href={project.github}
              target="_blank"
              rel="noreferrer"
              className="text-blue-600 hover:underline text-sm"
            >
              View on GitHub →
            </a>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
